import React from 'react'
import PropTypes from 'prop-types'
import Scorescreen from '../scorescreen'

export default function Scorecard(players) {
	return( <div>
			<h1> Scorecard </h1>
			{players.map((player) => (
				<Scorescreen 
					id = {player.id}
					key = {player.id}
					score = {player.score} />
				))
		}
			</div>)
}

Scorecard.propTypes = {
	players: PropTypes.arrayOf(PropTypes.shape({})).isRequired
}
